// SPDX-License-Identifier: MIT
pragma solidity 0.8.26;

// Import OpenZeppelin contracts for security and ownership management
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

// Main contract definition, inheriting from ReentrancyGuard and Ownable
contract DragoGame is ReentrancyGuard, Ownable {
    // Struct to represent a game event
    struct Event {
        uint256 startTime;         // Timestamp when the event started
        uint256 highestScore;      // Highest score achieved in the event
        address highestScorer;     // Address of the player with the highest score
        uint256 playerCount;       // Number of players in the event
        mapping(address => bool) hasPlayed;  // Tracking which addresses have played
    }

    // Constants defining game rules
    uint256 public constant EVENT_DURATION = 15 minutes;  // Duration of each event
    uint256 public constant MAX_PLAYERS = 3;              // Maximum number of players per event
    uint256 public constant ENTRY_FEE = 0.01 ether;       // Fee to join an event
    uint256 public constant PRIZE = 0.02 ether;           // Prize for the winner

    // State variables
    Event public currentEvent;     // Current active event
    bool public eventActive;       // Flag to indicate if an event is currently active

    // Events for logging important actions
    event GameStarted(uint256 startTime);
    event PlayerJoined(address player);
    event NewHighScore(address player, uint256 score);
    event EventEnded(address winner, uint256 winningScore);

    // Constructor sets the contract deployer as the owner
    constructor() Ownable(msg.sender) {}

    // Function to start a new game event
    function startGame() external payable nonReentrant {
        require(!eventActive, "An event is already active");
        require(msg.value == ENTRY_FEE, "Incorrect entry fee");

        eventActive = true;
        currentEvent.startTime = block.timestamp;
        currentEvent.playerCount = 1;
        currentEvent.hasPlayed[msg.sender] = true;

        emit GameStarted(currentEvent.startTime);
        emit PlayerJoined(msg.sender);
    }

    // Function for additional players to join an active event
    function joinGame() external payable nonReentrant {
        require(eventActive, "No active event");
        require(msg.value == ENTRY_FEE, "Incorrect entry fee");
        require(currentEvent.playerCount < MAX_PLAYERS, "Event is full");
        require(!currentEvent.hasPlayed[msg.sender], "Already played in this event");
        require(block.timestamp < currentEvent.startTime + EVENT_DURATION, "Event has ended");

        currentEvent.playerCount++;
        currentEvent.hasPlayed[msg.sender] = true;

        emit PlayerJoined(msg.sender);
    }

    // Function for players to submit their scores
    function submitScore(uint256 score) external nonReentrant {
        require(eventActive, "No active event");
        require(currentEvent.hasPlayed[msg.sender], "Player has not joined the event");

        // Update highest score if necessary
        if (score > currentEvent.highestScore) {
            currentEvent.highestScore = score;
            currentEvent.highestScorer = msg.sender;
            emit NewHighScore(msg.sender, score);
        }

        // End the event if max players reached or time is up
        if (currentEvent.playerCount == MAX_PLAYERS || block.timestamp >= currentEvent.startTime + EVENT_DURATION) {
            _endEvent();
        }
    }

    // Internal function to end the current event
    function _endEvent() private {
        eventActive = false;
        address winner = currentEvent.highestScorer;
        uint256 winningScore = currentEvent.highestScore;

        // Transfer prize to winner if there is one
        if (winner != address(0)) {
            payable(winner).transfer(PRIZE);
        }

        emit EventEnded(winner, winningScore);

        // Reset the event
        delete currentEvent;
    }

    // Function for the owner to withdraw accumulated fees
    function withdrawFees() external onlyOwner {
        uint256 balance = address(this).balance;
        payable(owner()).transfer(balance);
    }
}

